import React from "react";
import ReactDOM from "react-dom";
import bg from "./img/intro-bg.jpg";
import "./componentCss/ButtonCss.css";
import Button from "./components/Button";
import NavBar from "./components/NavBar";
import Footer from "./components/Footer";
import "bootstrap/dist/css/bootstrap.css";
import AboutUs from "./components/AboutUs";
import Services from "./components/Services";
import Greeting from "./components/Greeting";
import CallToAction from "./components/CallToAction";
import SectionHeader from "./components/SectionHeader";
import ClientComment from "./components/ClientComment";
import SocialMediaIcon from "./components/socialMediaIcon";
import FrequentlyAsked from "./components/FrequentlyAsked";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      introParts: [<SocialMediaIcon />, <NavBar />, <Greeting />],
      sections: [
        <AboutUs />,
        <Services />,
        <ClientComment />,
        <CallToAction />,
        <FrequentlyAsked />,
        <Footer />,
      ],
    };
  }

  renderParts = (partList) => {
    partList.map((part) => {
      return <div> {part} </div>;
    });
  };

  render() {
    const { introParts, sections } = this.state;
    return (
      <div>
        <div className="position-absolute ">
          <img style={{ width: "100%", height: "800px" }} src={bg} />
        </div>
        <div className="position-relative">this.renderParts(introParts);</div>
      </div>
    );
  }
}

export default App;
